import React from 'react';

const VideoItem = ({video}) => {
    console.log(video);
    return (
        <div className="item">
            <img alt={video.snippet.channelTitle} src={video.snippet.thumbnails.medium.url}/>
            {video.snippet.title}
        </div>
    )
};

export default VideoItem;
